import React from "react";
import { useState } from "react";
import '../css/ProjectList.css'

const ProjectList = ()=>{
    const [p1SlideIndex,setP1SlideIndex] = useState(0);
    const [p2SlideIndex,setP2SlideIndex] = useState(0);

    const next1 = ()=>{
        setP1SlideIndex((p1SlideIndex+1)%3);
        console.log(p1SlideIndex)
    }
    const prev1 = ()=>{
        let temp = p1SlideIndex-1;
        if(temp<0)
            temp+=3;

        setP1SlideIndex(temp%3);
    }

    return(
        <div className="project-list" id="work">
            <h3><span>02.</span>Some Things I've Made</h3>
            <div className="container">
                <div className="p1">
                    <div className='image-gallery'>
                        <div className="image-container">
                            <div className="slide" style={{display:(p1SlideIndex===0?'content':'none')}}>
                                <img src="/assert/project/p1.png"/>
                            </div>
                            <div className="slide" style={{display:(p1SlideIndex===1?'content':'none')}}>
                                <img src="/assert/project/p2.png"/>
                            </div>
                            <div className="slide" style={{display:(p1SlideIndex===2?'content':'none')}}>
                                <img src="/assert/project/p3.png"/>
                            </div>
                        </div>

                        <a class="prev" onClick={()=>next1()}>&#10094;</a>
                        <a class="next" onClick={()=>prev1()}>&#10095;</a>
                    </div>

                    <div className="project-description">

                    </div>
                </div>
            </div>
        </div>
    );
}

export default ProjectList;
